import React from "react";

// CSS
import "./Nav.css";

const Nav = () => {
    return (
      <div>
        <nav>
          <ul>
            <li>Home</li>
            <li>Register</li>
            <li>Login</li>
            <li>About</li>
          </ul>
        </nav>
      </div>
    );
}

export default Nav;
